import React,{useEffect}from "react";
import { useNavigate } from "react-router-dom";

export default function Welcome() {
    const navigate = useNavigate();
    useEffect(()=>{
        if(!localStorage.getItem('token')){
            navigate("/welcome");
        }
    },[location])
    
  return (
    <div>Welcome</div>
  )
}
